INSERT INTO `ij_critere` VALUES (27,'Competence','SELECT ScoreCompetence.score FROM CompetencePossede INNER JOIN Enseignant ON CompetencePossede.CodeEnseignantfk = Enseignant.CodeEnseignant INNER JOIN Competence ON CompetencePossede.CodeCompetencefk = Competence.CodeCompetence INNER JOIN ScoreCompetence ON Competence.CodeCompetence = ScoreCompetence.CodeCompetencefk INNER JOIN Cours ON ScoreCompetence.CodeCoursfk = Cours.CodeCours WHERE Cours.CodeCours = x1 AND Enseignant.CodeEnseignant = y1;','Ce critere permet d\'evaluer les enseignant par rapport a leur competences sur un cours determiner'),(28,'Disponibilite','SELECT Preference.disponibilite FROM Enseignant INNER JOIN Preference ON Enseignant.CodeEnseignant = Preference.CodeEnseignantfk INNER JOIN Cours ON Preference.CodeCoursfk = Cours.CodeCours WHERE Cours.CodeCours = x1 AND Enseignant.CodeEnseignant = y1;','Permet de conaitre la disponibilite d\'n enseignant'),(29,'Preference','SELECT Preference.score FROM Cours INNER JOIN Preference ON Cours.CodeCours = Preference.CodeCoursfk INNER JOIN Enseignant ON Preference.CodeEnseignantfk = Enseignant.CodeEnseignant WHERE Cours.CodeCours = x1 AND Enseignant.CodeEnseignant = y1;','Ce critere est utiliser pour mesurer la satisfaction des enseignants'),(30,'Volume horaire statutaire','SELECT Grade.VolumeHoraireStatuitaire FROM Competence INNER JOIN CompetencePossede ON Competence.CodeCompetence = CompetencePossede.CodeCompetencefk INNER JOIN ScoreCompetence ON Competence.CodeCompetence = ScoreCompetence.CodeCompetencefk INNER JOIN Enseignant ON CompetencePossede.CodeEnseignantfk = Enseignant.CodeEnseignant INNER JOIN Cours ON ScoreCompetence.CodeCoursfk = Cours.CodeCours INNER JOIN Grade ON Enseignant.CodeGradefk = Grade.CodeGrade WHERE Cours.CodeCours = x1 AND Enseignant.CodeEnseignant = y1;','Ce critere assure que les prof ne depassent pas leur volume horaire stutaire'),(31,'Critere Statut','SELECT Enseignant.Statut FROM Enseignant WHERE 1 AND Enseignant.CodeEnseignant = y1;','Permet la dermination de l\'origine de l\'enseignant');
/*!40000 ALTER TABLE `ij_critere` ENABLE KEYS */;
UNLOCK TABLES;

